         &lt;D:propstat&gt;
           &lt;D:prop&gt;
             &lt;R:bigbox&gt;
               &lt;R:BoxType&gt;Box type A&lt;/R:BoxType&gt;
             &lt;/R:bigbox&gt;
             &lt;R:author&gt;
               &lt;R:Name&gt;J.J. Johnson&lt;/R:Name&gt;
             &lt;/R:author&gt;
           &lt;/D:prop&gt;
